import React, { useState } from "react";

export default function StudentPanel({
  students,
  addStudent,
  deleteStudent,
  generateRollNo,
}) {
  const [studentName, setStudentName] = useState("");
  const [studentFatherName, setStudentFatherName] = useState("");
  const [studentCnic, setStudentCnic] = useState("");
  const [studentAge, setStudentAge] = useState("");
  const [studentDob, setStudentDob] = useState("");
  const [studentGender, setStudentGender] = useState("");
  const [studentContact, setStudentContact] = useState("");
  const [studentAddress, setStudentAddress] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    if (
      !studentName ||
      !studentFatherName ||
      !studentCnic ||
      !studentAge ||
      !studentDob ||
      !studentGender ||
      !studentContact ||
      !studentAddress
    ) {
      return alert("Please fill all student fields");
    }

    addStudent({
      name: studentName,
      fatherName: studentFatherName,
      cnic: studentCnic,
      age: studentAge,
      dob: studentDob,
      gender: studentGender,
      contact: studentContact,
      address: studentAddress,
    });

    setStudentName("");
    setStudentFatherName("");
    setStudentCnic("");
    setStudentAge("");
    setStudentDob("");
    setStudentGender("");
    setStudentContact("");
    setStudentAddress("");
  };

  return (
    <div className="panel">
      <h2>üë®‚Äçüéì Student Panel</h2>

      <form onSubmit={handleSubmit}>
        <div className="panel-form-row">
          <div className="field">
            <input
              className="input"
              type="text"
              placeholder="Name"
              value={studentName}
              onChange={(e) => setStudentName(e.target.value)}
            />
          </div>

          <div className="field">
            <input
              className="input"
              type="text"
              placeholder="Father Name"
              value={studentFatherName}
              onChange={(e) => setStudentFatherName(e.target.value)}
            />
          </div>

          <div className="field">
            <input
              className="input"
              type="text"
              placeholder="CNIC (e.g. 12345-6789012-3)"
              value={studentCnic}
              onChange={(e) => setStudentCnic(e.target.value)}
            />
          </div>

          <div className="field xsmall">
            <input
              className="input"
              type="number"
              placeholder="Age"
              value={studentAge}
              onChange={(e) => setStudentAge(e.target.value)}
            />
          </div>

          <div className="field narrow">
            <input
              className="input"
              type="date"
              value={studentDob}
              onChange={(e) => setStudentDob(e.target.value)}
            />
          </div>

          <div className="field narrow">
            <select
              className="input"
              value={studentGender}
              onChange={(e) => setStudentGender(e.target.value)}
            >
              <option value="">Gender</option>
              <option value="Male">Male</option>
              <option value="Female">Female</option>
            </select>
          </div>

          <div style={{ display: "flex", alignItems: "center" }}>
            <button className="create-button" type="submit">
              Add
            </button>
          </div>
        </div>

        <div className="panel-form-row">
          <div className="field">
            <input
              className="input"
              type="text"
              placeholder="Contact No"
              value={studentContact}
              onChange={(e) => setStudentContact(e.target.value)}
            />
          </div>
          <div className="field" style={{ flex: 2 }}>
            <input
              className="input"
              type="text"
              placeholder="Home Address"
              value={studentAddress}
              onChange={(e) => setStudentAddress(e.target.value)}
            />
          </div>
        </div>
      </form>

      <ul className="list">
        {students.map((s) => (
          <li key={s.id} className="list-item">
            <div>
              <strong>{s.name}</strong> (Roll No: {s.rollNo}) <br />
              Father: {s.fatherName} | Gender: {s.gender} <br />
              CNIC: {s.cnic} <br />
              Age: {s.age} | DOB: {s.dob} <br />
              Contact: {s.contact} <br />
              Address: {s.address}
            </div>

            <button className="delete-button" onClick={() => deleteStudent(s.id)}>
              ‚ùå
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}
